import React, { Component } from 'react';
import { Text, View, Linking } from 'react-native';
import Icon from 'react-native-vector-icons/FontAwesome';

export default class AboutThisApp extends Component {
  render() {
    return (
      <View style={{ flex: 1, justifyContent: "center", alignItems: "center" }}>
        <Text>SIMphony, SIMConnect reimagined.</Text>
        <View style={{ marginBottom: 10 }}></View>
        <Icon.Button name="github" backgroundColor="#800080" onPress = {()=> {Linking.openURL('https://github.com/harisnkr')}}>
          <Text style={{ color: 'white', fontFamily: 'Arial', fontSize: 16 }}>
            GitHub</Text>
        </Icon.Button>
      </View>
    );
  }
};
